import React, { useState } from "react";
import { Container, Button, Form, Row, Col } from "react-bootstrap";
import { useDispatch } from "react-redux";

function TourRule() {
    const tour = useDispatch((state) => state.tour);

    const initializeTourData = {
        tourName: tour.tourName,
        maxTeam: tour.maxTeam,
        minTeam: tour.minTeam,
        maxPlayerOfTeam: tour.maxPlayerOfTeam,
        minPlayerOfTeam: tour.minPlayerOfTeam,
        maxForeignPlayer: tour.maxForeignPlayer,
        maxAge: tour.maxAge,
        minAge: tour.minAge,
        isAcceptingRegister: tour.isAcceptingRegister,
        isClosed: tour.isClosed,
        dateStart: tour.dateStart,
        dateEnd: tour.dateEnd,
    };
    const [tourData, setTourData] = useState(initializeTourData);

    const handleChange = (e) => {
        setTourData({ ...tourData, [e.target.name]: e.target.value });
    };

    return (
        <Container className="mt-5">
            <h3 className="bg-danger text-center text-white">
                Quy định giải đấu
            </h3>
            <Form>
                <Form.Label>Tên giải đấu</Form.Label>
                <Form.Control
                    type="text"
                    value={tourData.tourName}
                    name="tourName"
                    onChange={handleChange}
                />
                <Row>
                    <Col>
                    <Form.Label>Số đội tối thiểu</Form.Label>
                <Form.Control
                    type="text"
                    value={tourData.tourName}
                    name="tourName"
                    onChange={handleChange}
                />
                    </Col>
                    <Col></Col>
                </Row>
                
                <Form.Label>Tên giải đấu</Form.Label>
                <Form.Control
                    type="text"
                    value={tourData.tourName}
                    name="tourName"
                    onChange={handleChange}
                />
                <Form.Label>Tên giải đấu</Form.Label>
                <Form.Control
                    type="text"
                    value={tourData.tourName}
                    name="tourName"
                    onChange={handleChange}
                />
                <Form.Label>Tên giải đấu</Form.Label>
                <Form.Control
                    type="text"
                    value={tourData.tourName}
                    name="tourName"
                    onChange={handleChange}
                />
                <Form.Label>Tên giải đấu</Form.Label>
                <Form.Control
                    type="text"
                    value={tourData.tourName}
                    name="tourName"
                    onChange={handleChange}
                />
                <Form.Label>Tên giải đấu</Form.Label>
                <Form.Control
                    type="text"
                    value={tourData.tourName}
                    name="tourName"
                    onChange={handleChange}
                />
                <Form.Label>Tên giải đấu</Form.Label>
                <Form.Control
                    type="text"
                    value={tourData.tourName}
                    name="tourName"
                    onChange={handleChange}
                />
                <Form.Label>Tên giải đấu</Form.Label>
                <Form.Control
                    type="text"
                    value={tourData.tourName}
                    name="tourName"
                    onChange={handleChange}
                />
                <Form.Label>Tên giải đấu</Form.Label>
                <Form.Control
                    type="text"
                    value={tourData.tourName}
                    name="tourName"
                    onChange={handleChange}
                />
                <Form.Label>Tên giải đấu</Form.Label>
                <Form.Control
                    type="text"
                    value={tourData.tourName}
                    name="tourName"
                    onChange={handleChange}
                />
                <Form.Label>Tên giải đấu</Form.Label>
                <Form.Control
                    type="text"
                    value={tourData.tourName}
                    name="tourName"
                    onChange={handleChange}
                />
                <Button type="submit">Save</Button>
            </Form>
        </Container>
    );
}

export default TourRule;
